import React, { Component } from "react";

class Discover extends Component {

  render() {
    return (
      <h3>
        What can I use Medicab for?
      </h3>
    );
    return (
      <p>
        Easily manage you prescriptions and search
        for information about them using the FDA
        database!
      <br></br>
        Add and Subtract your prescriptions as they
        are filled!
      <br></br>
        Request a ride to the Pharmacy where your
        prescription(s) are filled.
    </p>
    );
  }
}

export default Discover;
